import "./App.css";
import Navbar from "./components/Navbar";

function App() {
  return (
    <Navbar>
      <div class="card text-center">
        <img class="card-img-top" src="" alt="" />
        <div class="card-body">
          <h4 class="card-title">Title</h4>
          <p class="card-text">Body</p>
        </div>
      </div>
    </Navbar>
  );
}

export default App;
